INSERT INTO `products` (`ID`, `userID`, `title`, `amount`, `price`, `upload_image`, `product_name`, `categories`, `category`, `related`, `tags`, `product_condition`, `last_price`, `availability`, `shipment`, `description`, `status`, `date`) VALUES
('65eb1d5c40f2f', '61080af2dadew', 'Military Website', '$1200', 0, 'products_67144abcb59c6.png', '', 'Hip-Hop', 'Scripts', '', '', '', 0, 'in stock', '2', 'Testing', '', '2024-10-20 01:11:40'),
('65eda67fb84fe', '6569a80a08c2f', 'Launch the Future ', 'N100', 0, 'profile_65eda67fa9e85.jpg', '', 'Hip-Hop', '', '', '', '', 0, 'in stock', '4 days', 'Are you ready to elevate your credit union or financial institution to the next level? With my expertise, I will build you a modern, secure, and high-performing website designed specifically for credit unions like Stallon Credit Union. A powerful online presence is essential to attract new members, streamline transactions, and build trust.\n\nWhy Your Credit Union Needs This Website\nStunning User Interface (UI): A clean, responsive, and user-friendly design that works seamlessly on all devices.\nMember Portal Integration: Secure, easy-to-navigate portals for account management, loan applications, and savings tracking.\nOnline Loan Applications: Enable customers to apply for loans online, with automatic processing and status tracking.\nSecure Online Banking: We integrate top-notch security protocols to protect sensitive data, ensuring compliance with financial regulations.\nEngaging Content & Blog: Share financial tips and product updates that position your credit union as a leader in the industry.\nWhat Youll Get\nTailored Web Design: Every credit union has unique needsyour site will reflect your brand and values.\nSEO Optimization: Help your website rank higher on Google, driving traffic and conversions.\n24/7 Support: Ongoing technical support to ensure your website runs smoothly.\nMobile-Friendly Design: Delivering the best experience whether customers visit from a phone, tablet, or desktop.\nLets Bring Your Vision to Life!\nInvesting in a credit union website isnt just about having an online presenceits about building trust, offering convenience, and growing your membership base. With my web development service, youll get more than just a websiteyoull get a complete solution for success.', '', '2024-03-10 13:24:31'),
('6714bd647a0e8', '61080af2dadew', 'Full Script', '$9000', 0, 'products_6714bd646bb95.png', '', 'Full Scripts', '', '', '', '', 0, 'in stock', '2', 'Purchase this and you won&#039;t need to debug anymore', '', '2024-10-20 09:20:52'),
('671d32b7f3581', '61080af2dadew', 'Iono hosting Website', '$5000', 0, 'products_671d32b7e4668.png', '', 'Full Scripts', '', '', '', '', 0, 'in stock', '2', 'Cloud IT without compromises\r\nHighly scalable\r\nMaximum performance\r\nFull data sovereignty', '', '26 October, 2024');
