('6568de687ce09', '6568de687ce0e', 'Alice', 'Allyclarion', 'Music Director & Singer', 'allyclarion56@gmail.com', '07031050527', 'Female', 'artist', '1', 'Oluwatobiloba Daniel Anidugbe (born 1 May 1994), who is better known as Kizz Daniel (formerly Kiss Daniel),[2] is a Nigerian singer and songwriter. He rose to fame in 2014 with his debut single, \"Woju\".[3] He signed a record deal with G-Worldwide Entertainment in 2013, but left the label following a publicized contract dispute and court case.[4] He founded the Fly Boy Inc record label in November 2017.[5]\n\nOn 8 August 2022, Kizz Daniel was arrested in Dar es Salaam by the Tanzanian police force over failure to perform.[6]\n\nOn 3 February 2023, he was announced by Audiomack alongside Snazzy the Optimist, Asake and 1ucid as the top trending and most streamed artistes.', '$2y$10$DzFcIdTDFb9mcb0/gHV1c.NOIkO37ZdjCceYxbTFTWKllzutL7sbK', 'profile_6568de687bc9c.jpg', 'USA', 'New York', '47 W 13th St, New York, NY 10011, USA', '', '2023-11-30 20:11:36', '', '', '', '', ''),
