(5, '637ca42beb3aa', '637ca42beb3a3', '', 'The services provide for design ', 0, 'What is Service Design?\r\nService design is a process where designers create sustainable solutions and optimal experiences for both customers in unique contexts and any service providers involved. Designers break services into sections and adapt fine-tuned solutions to suit all users needs in contextbased on actors, location, and other factors.\r\n\r\nWhen you have two coffee shops right next to each other, and each sells the same coffee at the same price, service design is what makes you walk into one and not the other.\r\n\r\nService Design is about Designing for the Biggest Picture\r\nUsers dont access brands in a vacuum but within complex chains of interactions. For example, a car is a product, but in service design terms its a tool when an elderly customer wants to book an Uber ride to visit a friend in the hospital. Theres much to consider in such contexts. This user might be accessing Uber on a smartphone, which shes still learning to use. Perhaps shes infirm, too, lives in an assisted living facility, and must inform the driver about her specific needs. Also, shes not the only user involved here. Other users are any service providers attached to her user experience. For example, the driver that the customer books also uses Uberbut experiences a different aspect of it. To cater to various users and customers contexts as a designer, you must understand these sorts of relations between service receivers and service providers and the far-reaching aspects of their contexts from start to finish. Only then can you ideate towards solutions for these users/customers specific ecosystems while you ensure brands can deliver on expectations optimally and sustainably.', '', '', 'Development', '', 'portfolios', '', '', '', '', 'img637ca42beb0f3.jpg', '', '', '2022-11-22'),
(6, '6385efdfa0531', '6385efdfa0526', 'Michael Cocroft', 'Website Development / Maintenance', 0, 'I have known him for decades now and we are still together because he always does a professional job for Me and my Clients, Trust me, he will never disappoint you cause he has never disappointed me.', '', 'CEO', '', '', 'testimonials', 'Fiverr - (Aug  30, 2017 - Nov 27, 2022)', '', '', '', 'img6385efdf9fae9.jpeg', '', '', '2022-11-29'),
(7, '639b4d50c9674', '8147', 'Manistar', 'Lagos-Ibadan Expressway: Gridlock worsens amid road work suspension ', 0, '&lt;div&gt;&lt;div&gt;The gridlock at the Longbridge, Ogun State end of the Lagos-Ibadan Expressway caused by the reconstruction of the road, has worsened despite the company handling the project, Julius Berger Nigeria Limited, suspending operations.&lt;/div&gt;&lt;div&gt;The Director, South-West Federal Ministry of Works, Adedamola Kuti, had said the company suspended work to enable a hassle-free movement of travellers during the Yuletide.&lt;/div&gt;&lt;div&gt;About a week later, the Federal Road Safety Corps, Ogun State Command, in a statement, said the company had started removing the crash barriers on the road.&lt;/div&gt;&lt;div&gt;However, days after both claims, there has been no traffic improvement on the road as commuters continue to spend long hours in traffic.&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;On Wednesday morning, movement inward Lagos was at a standstill, as commuters groaned, while many were stranded at bus stops.&lt;/div&gt;&lt;div&gt;The traffic stretched to the Magboro end of the expressway as some motorists drove against traffic.&lt;/div&gt;&lt;div&gt;The spokesperson for the FRSC in Ogun State, Florence Okpe, said the gridlock persisted because the barriers were moved to another section of the road.&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;She said, The corridor commander made the earlier statement. He saw Julius Berger removing the barriers. However, today (Wednesday), they narrowed another portion of the road from the end of the Longbridge. Basically, they removed barriers from one section and used them to commence work in another section.&lt;/div&gt;&lt;div&gt;The Public Relations Officer 1, Traffic Compliance and Enforcement Corps, Babatunde Akinbiyi, said the traffic experienced on Wednesday might have been caused by some protesters.&lt;/div&gt;&lt;div&gt;He said, I learnt that there was a crisis in the area; some people were protesting or so. Thats why there was an issue around that axis. Thats why there was traffic.&lt;/div&gt;&lt;div&gt;A community leader in the area, Segun Sunmonu-Adams, said Julius Berger would vacate the site on December 15.&lt;/div&gt;&lt;div&gt;He said, The first information flying online that they will leave that place by December 5 is not correct. Ive been in touch with Julius Bergers project supervisor for the Lagos-Sagamu section, so I can say their plan is to leave around 15th.&lt;/div&gt;&lt;div&gt;The reason you experienced gridlock today (Wednesday) which wasnt there yesterday, is because the section inward Lagos was divided into two, the outer part is now being done, while the other has been closed.&lt;/div&gt;&lt;div&gt;&amp;nbsp;The U-turn for those going back to Lagos has been changed. That has caused confusion because it is no longer at the same point where it was before. So, thats the new thing implemented last night and the major reason you had terrible traffic this morning.&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;/div&gt;', '', 'Admin', '', '', 'blog', '', '', '', 'Services', 'img639b4d50c922b.jpg', 'News', '', '2022-12-15'),
